
<!DOCTYPE html>
<html>
<head>
    <title>Interactive Dental X-ray Segmentation</title>
    <style>
        body { font-family: Arial, sans-serif; margin: 0; padding: 0; background-color: #f5f5f5; }
        .container { display: flex; height: 100vh; }
        .image-area { flex: 3; position: relative; background-color: #000; display: flex; justify-content: center; align-items: center; }
        .sidebar { flex: 1; min-width: 300px; max-width: 400px; overflow-y: auto; padding: 20px; background-color: white; box-shadow: -2px 0 10px rgba(0,0,0,0.1); }
        #image-container { position: relative; }
        #base-image { max-height: 90vh; max-width: 100%; }
        .mask-overlay { position: absolute; top: 0; left: 0; width: 100%; height: 100%; pointer-events: none; mix-blend-mode: screen; opacity: 0; transition: opacity 0.2s; }
        .class-item { margin-bottom: 15px; padding: 10px; border-radius: 5px; transition: background-color 0.2s; cursor: pointer; }
        .class-item:hover { background-color: #f0f0f0; }
        .class-item.active { background-color: #e6f2ff; }
        .class-header { display: flex; align-items: center; }
        .color-box { width: 20px; height: 20px; margin-right: 10px; border-radius: 3px; }
        .class-name { font-weight: bold; flex-grow: 1; }
        .class-details { margin-top: 10px; font-size: 14px; padding: 10px; border-radius: 5px; background-color: #f9f9f9; display: none; }
        .view-buttons { display: flex; margin-bottom: 20px; }
        .view-btn { flex: 1; padding: 8px; margin: 0 5px; background-color: #e0e0e0; border: none; border-radius: 5px; cursor: pointer; }
        .view-btn.active { background-color: #0066cc; color: white; }
        h1 { margin: 0 0 20px 0; font-size: 24px; color: #333; }
        h2 { margin: 20px 0 15px 0; font-size: 18px; color: #444; border-bottom: 1px solid #eee; padding-bottom: 5px; }
    </style>
</head>

                classItem.onclick = () => toggleMask(mask.id);
                
                const r = mask.color[0];
                const g = mask.color[1];
                const b = mask.color[2];
                
                classItem.innerHTML = `
                    <div class="class-header">
                        <div class="color-box" style="background-color: rgb(${r},${g},${b})"></div>
                        <div class="class-name">${mask.class}</div>
                    </div>
                    <div class="class-details" id="details-${mask.id}">
                        <p><b>Confidence:</b> ${(mask.confidence * 100).toFixed(2)}%</p>
                        <p><b>Bounding Box:</b><br>
                        X1, Y1: (${mask.box[0].toFixed(1)}, ${mask.box[1].toFixed(1)})<br>
                        X2, Y2: (${mask.box[2].toFixed(1)}, ${mask.box[3].toFixed(1)})</p>
                        <p><b>Mask Area:</b> ${mask.area} pixels (${mask.percentage.toFixed(2)}% of image)</p>
                    </div>
                `;
                
                classList.appendChild(classItem);
            });
        }
        
        // Change the base image (original or detection)
        function changeBaseImage(type) {
            document.getElementById('base-image').src = images[type];
            
            // Update button states
            document.querySelectorAll('.view-btn').forEach(btn => {
                btn.classList.remove('active');
            });
            event.target.classList.add('active');
            
            // Hide all masks
            resetMasks();
        }
        
        // Toggle mask visibility and details
        function toggleMask(id) {
            const maskElement = document.getElementById(`mask-${id}`);
            const classItem = document.getElementById(`class-${id}`);
            const detailsElement = document.getElementById(`details-${id}`);
            
            // Check if already active
            const isActive = classItem.classList.contains('active');
            
            // Reset all masks first
            resetMasks();
            
            // If wasn't active, make it active
            if (!isActive) {
                maskElement.style.opacity = '1';
                classItem.classList.add('active');
                detailsElement.style.display = 'block';
            }
        }
        
        // Reset all masks to hidden state
        function resetMasks() {
            document.querySelectorAll('.mask-overlay').forEach(mask => {
                mask.style.opacity = '0';
            });
            
            document.querySelectorAll('.class-item').forEach(item => {
                item.classList.remove('active');
            });
            
            document.querySelectorAll('.class-details').forEach(details => {
                details.style.display = 'none';
            });
        }
        
        // Initialize the viewer when page loads
        window.onload = initViewer;
    </script>
</body>
</html>
